export default (state = {}, action) => {
  // console.log("ACTION", action);
  switch(action.type) {
    case "LOGIN":
    debugger;
      return
    case "SIGNUP":
    debugger
      return {...state, userCreate: {email: action.email, username: action.username, password: action.password, phone: action.phone}}
      default:
      return state;
    }



  }
